import React from 'react';

function Meals({ meals }) {
    const name = meals.nutrients;
    return (
        <main>
        <section className="nutrients">
          <h1>Macros</h1>
          <ul>
            <li>Calories: {name.calories.toFixed(0)}</li>
            <li>Carbohydrates: {name.carbohydrates.toFixed(0)}</li>
            <li>Fat: {name.fat.toFixed(0)}</li>
            <li>Protein: {meals.protein.toFixed(0)}</li>
          </ul>
        </section>
        </main>
    );
}

export default Meals
